  null,\n\t\"notes\": \"The New York State Office of Parks, Recreation and Historic
  Preservation (OPRHP) oversees more than 214 state parks and historic sites, encompassing
  nearly 335,000 acres, that are visited by 60 million people annually. These facilities
  contribute to the economic vitality and quality of life of local communities and
  directly support New Yorku2019s tourism industry. Parks also provide a place for
  families and children to be active and exercise, promoting healthy lifestyles. The
  agency is responsible for the operation and stewardship of the state park system
  as well as advancing a statewide parks, historic preservation, and open space mission.From
  the famed Bethpage Black, to the rolling terrain of the Robert Trent Jones' designed
  18-hole course at Green Lakes State Park, New York's state park golf courses rank
  among the best public courses in the world. For more information, visit http://nysparks.com/golf-courses/\",\n\t\"license_title\":
